import React from 'react';
import { useNavigate } from 'react-router-dom';

const Login = () => {
  const navigate = useNavigate();

  return (
    <div style={{ 
      backgroundColor: '#0a192f', height: '100vh', display: 'flex', 
      justifyContent: 'center', alignItems: 'center', color: '#00ff41' 
    }}>
      <div style={{ 
        background: '#112240', padding: '40px', borderRadius: '10px', 
        border: '1px solid #00ff41', textAlign: 'center', width: '300px' 
      }}>
        <h2>SYSTEM ACCESS</h2>
        <input type="text" placeholder="Username" style={styles.input} />
        <input type="password" placeholder="Password" style={styles.input} />
        <button style={styles.btn}>LOGIN</button>
        <p 
          onClick={() => navigate('/')} 
          style={{ fontSize: '12px', color: '#8892b0', cursor: 'pointer', marginTop: '20px' }}
        >
          [ Go Back to Home ]
        </p>
      </div>
    </div>
  );
};

const styles = {
  input: {
    width: '100%', padding: '10px', margin: '10px 0', background: '#0a192f', 
    border: '1px solid #233554', color: '#00ff41', outline: 'none'
  },
  btn: {
    width: '100%', padding: '10px', background: '#00ff41', border: 'none', 
    color: '#0a192f', fontWeight: 'bold', cursor: 'pointer', marginTop: '10px'
  }
};

export default Login;
